import classes from "./Certification.module.css";
import reactlogo from "../../../assets/reactlogo.png";
import { SiReact } from "react-icons/si";
import { SiJavascript } from "react-icons/si";

const Certification = () => {
  const openInNewTab = (url) => {
    window.open(url, "_blank", "noopener,noreferrer");
  };

  const certificateHandler = (event) => {
    event.preventDefault();
    openInNewTab("http://localhost:3000/education");
  };

  const reactCertificateHandler = (event) => {
    event.preventDefault();
    openInNewTab("https://www.udemy.com/certificate/UC-5a3a1e21-99b2-41cc-b6bf-3dc5470548ba/");
  };


  return (
    <div className={classes.certificate}>
      <h2>Certification</h2>
      <div className={classes.bigBox}>
        <div className={classes.rightBox}>
          {/* <img src={reactlogo} /> */}
          <div className={classes.reacticon}>
            <SiReact />
          </div>
          <div
            onClick={reactCertificateHandler}
            className={classes.rightBox__overlay}
          >
            <p>CERTIFICATE</p>
          </div>
        </div>
        <div className={classes.leftBox}>
          <h3>React - The Complete Guide</h3>
          <h4> - Maximilian Schwarzmüller</h4>
        </div>
      </div>
      <div className={classes.bigBox_2}>
        <div className={classes.rightBox_2}>
          {/* <img src={reactlogo} /> */}
          <div className={classes.jsicon}>
            <SiJavascript />
          </div>
          <div onClick={certificateHandler}
            className={classes.rightBox_2__overlay}>
            <p>CERTIFICATE</p>
          </div>
        </div>
        <div className={classes.leftBox_2}>
          <h3>Java Script - The Complete Guide</h3>
          <h4> - Maximilian Schwarzmüller</h4>
        </div>
      </div>
    </div>
  );
};

export default Certification;
